import '../styles/Testimonials.css'
import Test from './Images/Testimonial.png'
function Testimonials(){
return(
    <div>Testimonials
        <div className='head3'>Customer Testimonials</div>
        <div className='subhead'>This tool has transformed my productivity and organization!</div>
        <div>
            <div>Using this website has made my tasks so much easier! I can't imagine my day without it."</div>
            <img src={Test}></img>
        </div>
    </div>
)
}
export default Testimonials;
